package com.bdoemu.core.network.sendable;

import com.bdoemu.commons.network.SendByteBuffer;
import com.bdoemu.commons.network.SendablePacket;
import com.bdoemu.commons.utils.HexUtils;
import com.bdoemu.core.network.GameClient;
import com.bdoemu.gameserver.dataholders.RegionData;
import com.bdoemu.gameserver.model.world.region.templates.RegionTemplate;

import java.util.Collection;

public class SMInitializeRegionWeatherData extends SendablePacket<GameClient> {
    private Collection<RegionTemplate> regionTemplates;

    public SMInitializeRegionWeatherData() {
        this.regionTemplates = RegionData.getInstance().getTemplates();
    }

    protected void writeBody(final SendByteBuffer buffer) {
        buffer.writeB(HexUtils.hex2Byte(""));
    }
}
